import './App.css';
import { Route, Routes } from 'react-router-dom';
import Login from './components/Login';
import EmployeeDetail from './components/EmployeeDetail';

function App() {
  return (
    <BrowserRouter>
      <Routes>
      <Route path='/' element={<Login />} />
      <Route path='/employee' element={<EmployeeDetail />} />
    </Routes>
    </BrowserRouter>
  
  );
}

export default App;
